import React, { useState, useEffect } from "react";

export default function AddressTXList({ ticketArray }) {
  return (
    <div>
      <table>
        <thead>
          <tr>
            <td>winners</td>
          </tr>
        </thead>
        <tbody>
          {ticketArray.map((winner, i) => {
            return (
              <tr key={winner + i}>
                <td>{winner}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
      <br />
      Entries:
      <table>
        <thead>
          <tr>
            <td>address</td>
            <td>amount</td>
          </tr>
        </thead>
        <tbody>
          {ticketArray.map((tx) => {
            return (
              <tr key={tx[0] + i}>
                <td>{tx[0]}</td>
                <td>{tx[1]}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
